import {GET_LAT_LONG_RESPONSE} from '../actionsTypes'

export  interface IState{
    latLong:object,
}

const intialState:IState={
    latLong:{},
    weatherData:[]
}

export const appReducer=(state=intialState,action:any)=>{

switch(action.type){
    case GET_LAT_LONG_RESPONSE:
       return {

    ...state,
    latLong:action.payload

        }

        default :
        return {...state}
}

}
